import React, { Component } from 'react'

export default class HumburgerIcon extends Component {
	render () { 
		return (<svg id="Layer_2" data-name="Layer 2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20">
			<rect class="cls-1" x="0.25" y="2.54" width="19.51" height="2.98" rx="1.49"/>
			<rect class="cls-1" x="0.25" y="8.51" width="19.51" height="2.98" rx="1.49"/>
			<rect class="cls-1" x="0.25" y="14.48" width="19.51" height="2.98" rx="1.49"/>
		</svg>
		);
	}
}
